  const setShowYourSurveys = (bool:boolean) => {props.setShowYourSurvey(bool)}
  const setShowData = (bool:boolean) => {props.setShowData(bool)}
  return (
    <div className="datanav-container">
        <SecondaryButton width={'200px'} fontSize={'18px'} onClick={() => {
          setShowYourSurveys(true);
          setShowData(false);
        }}>Your Surveys</SecondaryButton>
        <SecondaryButton width={'200px'} fontSize={'18px'} onClick={() => {
          setShowYourSurveys(false);
          setShowData(true);
        }}>Survey Data</SecondaryButton>
    </div>
  )
};

